import React, { useState} from 'react'

const initialState = {
    fullname: '',
    contact: '',
    email: '',
    password: ''
}

const SignUp = () => {
    
    const [state, setState] = useState(initialState);

    const handleChange = (event) => { 
        setState({...state,[event.target.name]:event.target.value});
    }

    const handleSubmit = (event) => { 
        event.preventDefault();
        console.log("name: ", event.currentTarget.fullname.value);
        console.log("contact:", event.currentTarget.contact.value);
        console.log("email:", event.currentTarget.email.value);
        console.log("password:", event.currentTarget.password.value);
        return false;
    }

  return (
    <div>
          <h1>Sign Up</h1>
          <form action="post" onSubmit={handleSubmit}>
              <div>
                  <label htmlFor="fullname">Fullname: </label>
                  <input type="text" id="fullname" name="fullname" value={state.fullname} onChange={handleChange} required/>
              </div>
              <div>
                  <label htmlFor="contact">Contact: </label>
                  <input type="tel" id="contact" name="contact" value={state.contact} pattern="[0-9]{5}-[0-9]{5}" onChange={handleChange} required/>
              </div>
              <div>
                  <label htmlFor="email">Email: </label>
                  <input type="email" id="email" name="email" value={state.email} onChange={handleChange} required/>
              </div>
              <div>
                  <label htmlFor="password">Password: </label>
                  <input type="password" id="password" name="password" value={state.password} onChange={handleChange} required/>
              </div>

          </form>
    </div>
  )
}

export default SignUp
